import React from 'react'
import './App.css'
import Home from './components/Home'
import Header from './components/Header'
import { Routes, Route} from "react-router-dom";


const App = () => {
  return (
    <div>
      <Header/>
       <Routes>
       <Route path="/" element={<Home />} />
     
      </Routes>
    </div>
  )
}

export default App
